,p_process_name=>'Cargar Colecciones'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare',
'    l_mat_id    number;',
'    l_alu_id varchar2(30) := :P21_ALUMNOS;',
'begin',
'    ',
'',
'    -- Crear Nuevo Alumno',
'    if :P21_OPCIONES_ALUMNO = ''NUEVO'' then',
'        apex_collection.add_member(',
'            p_collection_name => ''ALUMNOS'',',
'            p_c001            => :P21_ALU_ID,',
'            p_c002            => :P21_DNI,',
'            p_c003            => :P21_NOMBRE,',
'            p_c004            => :P21_APELLIDO,',
'            p_c005            => :P21_TELEFONO,',
'            p_c006            => :P21_EDAD,',
'            p_c007            => :P21_GENERO,',
'            p_c008            => :P21_PAIS_ID           ',
'        );',
'    end if;',
'',
unistr('    -- Loop a trav\00E9s de la colecci\00F3n ITEMS_MATRICULA '),
'',
'    for i in 1..apex_application.g_f01.count loop',
'        apex_collection.add_member(',
'            p_collection_name => ''ITEMS_MATRICULA'',',
'            p_c001            => to_number(apex_application.g_f01(i)), -- curso_id',
'            p_c002            => to_number(apex_application.g_f02(i)), -- precio',
'            p_c003            => to_number(apex_application.g_f03(i))  -- cantidad',
'        );',
'    end loop;',
'end;',
''))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(9322441168702030703)
,p_process_when=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare',
'  l_matriculas number := 0;',
'begin',
'',
'    for i in 1..apex_application.g_f01.count loop',
'        l_matriculas := l_matriculas + to_number(apex_application.g_f03(i));',
'    end loop;',
'',
'    if (l_matriculas = 0) then',
'        return false;',
'    else',
'        return true;',
'    end if;',
'end;',
''))
,p_process_when_type=>'FUNCTION_BODY'
,p_process_when2=>'PLSQL'
,p_internal_uid=>12839599835332997339
