wwv_flow_imp_page.create_page_process(
 p_id=>wwv_flow_imp.id(12839600472066997345)
,p_process_sequence=>10
,p_process_point=>'AFTER_SUBMIT'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>unistr('Generar matr\00EDcula')
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'-- Declarar las variables     ',
'',
'declare ',
'    l_mat_id number;   ',
'    l_alu_id varchar2(30) := :P21_ALUMNOS; ',
'    vtotal number; ',
'	',
'begin ',
'	',
'-- Crear Nuevo Alumno     ',
'',
'	if :P21_OPCIONES_ALUMNO = ''NUEVO'' then',
'      insert into EDU_ALUMNOS ',
'      (DNI, NOMBRE, APELLIDO, TELEFONO, EDAD, GENERO, PAIS_ID)',
'	   values (',
'     	:P21_DNI,',
'        :P21_NOMBRE,',
'       	:P21_APELLIDO,',
'       	:P21_TELEFONO,',
'       	:P21_EDAD,',
'       	:P21_GENERO,',
'       	:P21_PAIS_ID) ',
'	    returning alu_id ',
'      into l_alu_id; ',
'      :P21_ALUMNOS := l_alu_id; ',
'    end if;     ',
' ',
' -- Insertar una fila dentro de la tabla matriculas ',
' ',
'  insert into edu_matriculas(mat_id, alu_id, fecha, total, usuario)',
'values(edu_matriculas_seq.nextval, l_alu_id, systimestamp, null, upper(:APP_USER))',
'returning mat_id into l_mat_id;',
'',
'',
' -- Recorrer la coleccion e insertar registro/s dentro de la tabla edu_matricula_cursos',
'    for i in (',
'        select c001 as curso_id,',
'               c002 as precio,',
'               c003 as cantidad',
'              from apex_collections ',
'              where collection_name = ''ITEMS_MATRICULA'' ',
'             and c003 <> 0',
'             order by 2',
'    )',
'   loop',
'        insert into edu_matricula_cursos(mat_cursos_id, mat_id, curso_id) ',
'             values (edu_matricula_cursos_seq.nextval,l_mat_id,i.curso_id);',
'   end loop;',
'   commit;',
'',
'  ',
unistr('-- Configurar el item P23_MAT_ID para la matricula que reci\00E9n se realiz\00F3 '),
'',
'    :P23_MAT_ID := l_mat_id; ',
' ',
'-- Actualizar Total de la tabla edu_matriculas ',
' ',
unistr('-- Cursor impl\00EDcito para tomar el valor del precio total  	'),
'',
'	select sum(c.precio) Total ',
'  	into vtotal ',
' 	from edu_cursos c, edu_matriculas m, edu_matricula_cursos mc ',
' 	where c.curso_id = mc.curso_id ',
'	and mc.mat_id = m.mat_id ',
'	and m.mat_id = :P23_MAT_ID; ',
' ',
'-- Actualizar total de la cabecera de la matricula ',
'         UPDATE EDU_MATRICULAS ',
'         SET total = vtotal ',
'         WHERE MAT_ID = :P23_MAT_ID; ',
'         COMMIT; ',
' ',
unistr('	apex_application.g_print_success_message := ''Matr\00EDcula Generada con \00E9xito.'';  '),
' ',
unistr('-- Truncamos la colecci\00F3n despu\00E9s de que la matr\00EDcula ha sido generada '),
'',
'    apex_collection.truncate_collection(p_collection_name => ''ALUMNOS''); ',
'',
'    apex_collection.truncate_collection(p_collection_name => ''ITEMS_MATRICULA'');',
'end;',
'',
'',
''))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_internal_uid=>12839600472066997345
);
wwv_flow_imp_page.create_page_process(
 p_id=>wwv_flow_imp.id(12839600337838997344)
,p_process_sequence=>10
,p_process_point=>'BEFORE_HEADER'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>unistr('A\00F1adir cursos a la colecci\00F3n de matricula ')
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare',
'  l_count number := 0;',
'begin',
'for x in (select c.rowid, c.* from edu_cursos c where curso_id = :P21_CURSO_ID)',
'loop',
'  select count(*) ',
'  into l_count',
'  from wwv_flow_collections',
'  where collection_name = ''MATRICULA''',
'  and c001 =  x.curso_id;',
'  if l_count >= 1 then',
'    exit;',
'  end if;',
'  apex_collection.add_member(p_collection_name => ''MATRICULA'', ',
'    p_c001 => x.curso_id, ',
'    p_c002 => x.nombre,',
'    p_c003 => x.precio,',
'    p_c004 => 1,',
'    p_c010 => x.rowid);',
'end loop;',
'end;',
''))
,p_process_clob_language=>'PLSQL'
,p_internal_uid=>12839600337838997344
);
end;
